import Input from './components/Input';

const App = () => {
  const [form, handleChange] = useForm({
    name: ''
  })

  console.log(form);

  return (
    <form>
      <Input
        label='Name'
        name='name'
        value={form.name}
        onChange={handleChange} />
      <Input
        label='Lastname'
        name='lastname'
        value={form.lastname}
        onChange={handleChange} />
      <Input
        label='Name'
        name='name'
        value={form.name}
        onChange={handleChange} />
    </form>
  );
}

export default App;
